import React from "react";
import { useParams } from "react-router-dom";

export const Profile: React.FC = () => {
  const { username } = useParams<{ username: string }>();

  console.log("Username from useParams:", username);

  return (
    <div className="flex items-center justify-center h-full">
      <div className="box-border h-32 w-80 p-4 border rounded-xl border-gray-300">
        <div className="box-border h-10 w-10 p-4 border rounded-full border-gray-3000">
          <img className="h-full w-full object-cover" src="hey.jpg"></img>
        </div>
        <textarea></textarea>
      </div>
    </div>
  );
};
